import React, {Component} from 'react';
import {Redirect} from 'react-router-dom';

class ZipFormComponent extends Component {
    constructor(props) {
        super(props);
        this.handleChange = this.handleChange.bind(this);
        this.state = {
            value: "",
            zip_code: ""
        };
    }

    handleChange = (e) => {
        const {name, value} = e.target;
        this.setState({[name] : value});

        let  childFamilyData= { zipData :
            {zip_code: this.state.zip_code }
        };

        this.props.onSelectedChild(childFamilyData);
    };

    render() {
        return (
            <div>
                 <p><label>Zip code</label><input  onChange={this.handleChange} name="zip_code" id="zip_code" type="text"/></p>
            </div>
        )
    }
}
export default ZipFormComponent;
